import React, { useState, useEffect, useRef } from "react";
import { Link } from "react-router-dom";
import { Button } from "@mui/material/Button";

import styles from "./Header.module.scss";
import Container from "@mui/material/Container";

import logo from "../../media/logo/logo.png";
import user from "../../media/header/auth-like-menu/user.png";
import like from "../../media/header/auth-like-menu/like.png";
import menu from "../../media/header/auth-like-menu/menu.png";
import tg from "../../media/header/socials/tg.png";
import youtube from "../../media/header/socials/youtube.png";
import vk from "../../media/header/socials/vk.png";
import down_arrow from "../../media/header/down-arrow.png";

import art_city_logo from "../../media/projects/art-city/logo.png";
import art_city_landscape from "../../media/projects/art-city/landscape.png";

export const Header = () => {
    const isAuth = false;

    const onClickLogout = () => {};

    const [isOpen, setIsOpen] = useState(false); // Состояние для отслеживания открытия/закрытия меню

    const toggleMenu = () => {
        setIsOpen(!isOpen); // Переключение состояния открытия/закрытия
    };

    const [headerHeight, setHeaderHeight] = useState(0);
    const [navWidth, setNavWidth] = useState(0);
    const headerRef = useRef(null);
    const navRef = useRef(null);

    useEffect(() => {
        // Устанавливаем начальные размеры хедера и навигации
        if (headerRef.current) {
            setHeaderHeight(headerRef.current.offsetHeight);
        }
        if (navRef.current) {
            setNavWidth(navRef.current.offsetWidth);
        }

        // Обновляем размеры при изменении окна
        const handleResize = () => {
            if (headerRef.current) {
                setHeaderHeight(headerRef.current.offsetHeight);
            }
            if (navRef.current) {
                setNavWidth(navRef.current.offsetWidth);
            }
        };

        window.addEventListener("resize", handleResize);

        return () => {
            window.removeEventListener("resize", handleResize);
        };
    }, []);

    return (
        <header ref={headerRef}>
            <section className={styles.header_top}>
                <section className={styles.logo_nav}>
                    <img src={logo} alt="logo" />
                    <nav>
